import React, { useState, useEffect } from 'react';

const ResidentialResaleForm = ({ districts }) => {
    const [formData, setFormData] = useState({});

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({ ...formData, [name]: value });
    };

    const handleImageChange = (e) => {
        setFormData({ ...formData, images: e.target.files });
    };

    const calculate = () => {
        const houseLength = parseFloat(formData.HouseLength || 0);
        const houseWidth = parseFloat(formData.HouseWidth || 0);
        const landLength = parseFloat(formData.LandLength || 0);
        const landWidth = parseFloat(formData.LandWidth || 0);

        const houseArea = houseLength * houseWidth;
        const landArea = landLength * landWidth;

        setFormData({
            ...formData,
            HousePlotArea: houseArea.toFixed(2),
            HouseCent: (houseArea / 435.6).toFixed(2),
            LandPlotArea: landArea.toFixed(2),
            LandCent: (landArea / 435.6).toFixed(2),
        });
    };

    useEffect(() => {
        calculate();
    }, [formData.HouseLength, formData.HouseWidth, formData.LandLength, formData.LandWidth]);

    const handleSubmit = (e) => {
        e.preventDefault();
        const data = new FormData();
        Object.keys(formData).forEach((key) => {
            if (key === 'images') {
                Array.from(formData.images).forEach(file => data.append('images', file));
            } else {
                data.append(key, formData[key]);
            }
        });
        // Submit data via fetch or axios
    };

    return (
        <div className="container">
            <form className="form" onSubmit={handleSubmit} encType="multipart/form-data">
                <h3 className="alert alert-warning">Residential Resale</h3>

                <h4 className="alert alert-primary">Property Details</h4>
                <h6 className="alert alert-info">House</h6>

                <div className="row">
                    {/* BHK Type */}
                    <div className="col-md-4">
                        <label>BHK Type *</label>
                        <select name="BhkType" className="form-control" onChange={handleChange}>
                            <option disabled selected>Select</option>
                            {["1 RK", "1 BHK", "2 BHK", "3 BHK", "4 BH", "4+ BH"].map((opt) => (
                                <option key={opt} value={opt}>{opt}</option>
                            ))}
                        </select>
                    </div>

                    {/* Total Floor */}
                    <div className="col-md-4">
                        <label>Total Floor *</label>
                        <select name="TotalFloor" className="form-control" onChange={handleChange}>
                            <option disabled selected>Select</option>
                            {["No Floor", 1, 2, 3, "4+"].map((opt) => (
                                <option key={opt} value={opt}>{opt}</option>
                            ))}
                        </select>
                    </div>

                    {/* Property Age */}
                    <div className="col-md-4">
                        <label>Property Age *</label>
                        <select name="PropertyAge" className="form-control" onChange={handleChange}>
                            <option disabled selected>Select</option>
                            {["Less than a Year", "1 to 3 Years", "3 to 5 Years", "5 to 10 Years", "More than 10 Years"].map((opt) => (
                                <option key={opt} value={opt}>{opt}</option>
                            ))}
                        </select>
                    </div>
                </div>

                {/* House Dimensions */}
                <div className="row">
                    <div className="col-md-4">
                        <label>House Length *</label>
                        <input type="number" name="HouseLength" className="form-control" onChange={handleChange} step="0.01" />
                    </div>
                    <div className="col-md-4">
                        <label>House Width *</label>
                        <input type="number" name="HouseWidth" className="form-control" onChange={handleChange} step="0.01" />
                    </div>
                    <div className="col-md-4">
                        <label>Plot Area</label>
                        <input type="number" name="HousePlotArea" value={formData.HousePlotArea || ''} readOnly className="form-control" />
                    </div>
                </div>
                <div className="row">
                    <div className="col-md-4">
                        <label>Cent</label>
                        <input type="number" name="HouseCent" value={formData.HouseCent || ''} readOnly className="form-control" />
                    </div>
                </div>

                {/* More sections go here... */}

                {/* File Upload */}
                <h4 className="alert alert-primary">Upload Images</h4>
                <input type="file" name="images" multiple accept="image/*" onChange={handleImageChange} className="form-control" />

                <h4 className="alert alert-primary">Contact Details</h4>
                <div className="row">
                    <div className="col-md-6">
                        <label>Primary Number *</label>
                        <input type="tel" name="PrimaryNumber" className="form-control" pattern="[0-9]{10}" onChange={handleChange} />
                    </div>
                </div>

                <hr />
                <button type="submit" className="btn btn-success mt-3">Submit</button>
            </form>
        </div>
    );
};

export default ResidentialResaleForm;
